                reddataline.push(reddataline1)
            }
        }
        else{
            result.push({"lng":g5.dataset10.data[1][i].split(',')[0],"lat":g5.dataset10.data[1][i].split(',')[1],"blue":g5.dataset10.data[2][i]}) 
